import React from 'react';
import styled from 'styled-components';
import Todoitem from './Todoitem';
import { MdDone, MdDelete } from 'react-icons/md';

const Todolistbox = styled.div`
  flex: 1;
  padding: 20px 32px;
  padding-bottom: 48px;
  overflow-y: auto;

`;

function Todolist() {
  return <Todolistbox>
    <MdDone />
    <MdDelete />
  </Todolistbox>;
}

export default Todolist;
